import { Box, LinearProgress, Typography } from "@mui/material";
import { styled } from "@mui/system";
import React, { useState } from "react";
import data_borne from "./data_borne.json";
import MyLogin from "./MyLogin";

function AppBorneMulhouse1() {
  const [dataBorne] = useState(data_borne);

  const MyBox = styled(Box)({
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  });

  function borneAvailable() {
    let e;
    if (dataBorne.propriety.available === true) {
      e = (
        <Typography variant="h3" sx={{ color: "green" }}>
          Disponible
        </Typography>
      );
    }
    if (dataBorne.propriety.available === false) {
      e = (
        <Typography variant="h3" sx={{ color: "red" }}>
          Indisponible
        </Typography>
      );
    }
    return e;
  }

  const [progressBar, setprogressBar] = useState(1);

  useEffect(() => {
    setprogressBar(20);
  }, MyLogin);

  return (
    <>
      <MyBox>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </MyBox>

      <MyBox>{borneAvailable()}</MyBox>
      <MyBox>
        <LinearProgress
          variant="determinate"
          sx={{
            m: 2,
            width: "50%",
            height: 10,
            borderRadius: 5,
          }}
          value={progressBar}
        />
      </MyBox>
      <MyBox sx={{ boxShadow: 3, borderRadius: 1 }}>
        <MyLogin />
      </MyBox>
    </>
  );
}

export default AppBorneMulhouse1;
